import './App.css';
import { React } from 'react';
import { SignUp } from './SignUp';
import { Link } from 'react-router-dom';
import { useState } from 'react';

function Login() {
  const [username,setUsername]=useState("");
  const [password,setPassword]=useState("");
  return (
    <>
      <div className="h-40 my-3 flex justify-center">
        <form action="">
          <fieldset className='border-4 border-double border-purple-900 h-96 w-96'>
            <legend className='flex mx-auto'>LOGIN DETAILS</legend>
            <label htmlFor="name_id" className='ml-10 relative top-4'>Username</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72 rounded-md ' required="required"  type="text" id="name_id" placeholder={password.length==0?`Enter your Username`:password} />
            <br />
            <label htmlFor="number_id" className='ml-10 top-4 relative' >Password</label> <br />
            <input className='h-10 ml-10 mt-4 border-4 border-gray w-72' required="required" type="password" name="number_name" id="number_id" placeholder='Enter your Password' />
            <br />
            <button className="bg-blue-500 hover:bg-blue-600 mt-4 ml-10 w-72 h-10">Log In</button>
            <p className='mt-4 ml-12'>Don't have an account?<Link to="/SignUp" className='underline'>Register Here</Link></p>
          </fieldset>
        </form>
      </div>
    </>
  );
}

export default Login;
